import React from 'react';
import iPhoneSvg from './../../assets/images/iPhone-13-Pro-Max.svg';
import './About.scss';

export const About = () => {
  return (
    <section className="about container d-flex ">
      <div className="about__description">
        <h1>Аксессуары для Iphone 13 Pro Max</h1>
      </div>
      <figure></figure>
    </section>
  );
};
